import { FETCH_USERS, NEW_USERS } from "../types";
import { actions } from "../actions/userActions";

const initialState = {
    users: [],
    user: {}
}


export default function(state = initialState, actions){
    switch(actions.type) {
        case FETCH_USERS: 
         return {
             ...state,
             users: actions.payload
         }
    }
}






